import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import Navbar from "./components/Navbar";
import Section from "./components/Section";
import AboutMe from "./components/pages/AboutMe";
import Home from "./components/pages/Home";
import Interests from "./components/pages/Interests";

class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar />
        <Home/>
        <Section
          title="About Me"
          subtitle={<AboutMe/>}
          dark={true}
          id="section1"
        />
        <Section
          title="Interests"
          subtitle={<Interests/>}
          dark={false}
          id="section2"
        />
        <Section
          title="Hobbies"

          dark={true}
          id="section3"
        />
        <Section
          title="Section 4"

          dark={false}
          id="section4"
        />
        <Section
          title="Section 5"

          dark={true}
          id="section5"
        />
      </div>
    );
  }
}

export default App;
